import React, { useState } from 'react';
import '../styles.css'

const DropdownMenu = () => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  return (
    <div>
      <button onClick={toggleDropdown} className="dropdown-button">
        Select Skills
      </button>
      {dropdownOpen && (
        <div className="dropdown-menu">
          <label>
            <input type="checkbox" value="option1" /> Adaptability
          </label>
          <label>
            <input type="checkbox" value="option2" /> Communication
          </label>
          <label>
            <input type="checkbox" value="option3" /> Creative
          </label>
          <label>
            <input type="checkbox" value="option4" /> Interpersonal Communication
          </label>
          <label>
            <input type="checkbox" value="option5" /> Leadership
          </label>
          <label>
            <input type="checkbox" value="option6" /> Problem Solving
          </label>
          <label>
            <input type="checkbox" value="option7" /> Strong Work Ethic
          </label>
          <label>
            <input type="checkbox" value="option8" /> Teamwork
          </label>
          <label>
            <input type="checkbox" value="option9" /> Time Management
          </label>
        </div>
      )}
    </div>
  );
};

export default DropdownMenu;
